import React from "react";
import "./Home.css";

<></>;
function Home() {
  return (
    <>
      <div>
        <div className="mainhome">
          <div className="content">
            <h1>The Finest Yield</h1>
            <p>
              We prioritize quality and productivity on our clients' <br />{" "}
              farms through crop selection optimization and advanced <br /> soil
              management. Our commitment to agricultural innovation <br /> keeps
              us at the forefront of industry advancements, ensuring <br /> we
              apply cutting-edge technologies for increased farm productivity.{" "}
              <br /> With our client-centric approach and precision farming
              solutions, <br /> we aim to maximize crop yields sustainably.
            </p>
          </div>
          <div className="img1">
            <img src="./images/home/home.jpg.jpg" alt="" />
          </div>
        </div>
      </div>
    </>
  );
}

<></>;
export default Home;
